const title = (props)=>(
    <div>
        <img src="avatar.png" alt="Avatar" />
        <style jsx>
        {`          
            img{
                vertical-align: middle;
                width: 50px;
                height: 50px;
                border-radius: 50%;
            }
        `}
        </style>
    </div>
);

export default title;
